const Icon = module.exports = React.memo(function VizalityIcon ({
  name,
  icon,
  width = '24',
  height = '24',
  size,
  className,
  iconClassName,
  color = 'currentColor',
  tooltip,
  tooltipColor = 'black',
  tooltipPosition = 'top',
  onClick,
  onContextMenu,
  hasWrapper = true,
  ...props
}) {
  if (size) {
    width = size;
    height = size;
  }

  if (!name) {
    return error(_module, _submodule, null, `You must specify a 'name' property for an Icon component.`);
  }

  const blacklist = [ './addDefaultIconProps', './ApplicationPlaceholder', './DiscordNitro',
    './DiscordWordmark', './InboxEmptyStateStars', './Gradient', './Nitro', './NitroClassic',
    './NitroStacked', './NitroClassicHorizontal', './PremiumGuildSubscriptionLogoCentered',
    './PremiumGuildSubscriptionLogoLeftAligned', './ActivityFilled', './Arrow', './IconType',
    './PremiumGuildTier', './PremiumGuildTier1Simple', './PremiumGuildTier2Simple',
    './PremiumGuildTier3Simple', './PremiumGuildTierSimple' ];

  const registry = getModule(m => m.id && typeof m.keys === 'function' && m.keys().includes('./Activity'));

  const DiscordIcons = registry.keys()
    .filter(k => !k.endsWith('.tsx') && !k.endsWith('.css') && !blacklist.includes(k))
    .map(m => m.substring(2));

  Icon.Names = [].concat(DiscordIcons, Object.keys(Icons));

  const isClickable = Boolean(onClick || onContextMenu);

  let SVG;

  if (icon) {
    SVG = icon;
  } else {
    if (Icons[name]) {
      SVG = Icons[name];
    } else {
      SVG = registry(`./${name}`).default;
    }
  }

  if (!SVG && !icon) {
    return error(_module, _submodule, null, `Invalid "name" property specified ("${name}") for Icon component. A full list of available icon names:`, Icon.Names);
  }

  const render = () => {
    // hasWrapper
    if (hasWrapper) {
      // hasWrapper and tooltip
      if (tooltip) {
        // hasWrapper and tooltip and clickable
        if (isClickable) {
          return (
            <TooltipContainer
              text={tooltip}
              color={tooltipColor}
              position={tooltipPosition}
            >
              <Clickable
                className={joinClassNames(className, 'vz-icon-wrapper')}
                onClick={onClick}
                onContextMenu={onContextMenu}
              >
                <SVG
                  className={joinClassNames(iconClassName, 'vz-icon', `vz-icon-${toKebabCase(name)}`)}
                  width={width}
                  height={height}
                  color={color}
                  {...props}
                />
              </Clickable>
            </TooltipContainer>
          );
        }
        // hasWrapper and tooltip and !clickable
        return (
          <TooltipContainer
            className={joinClassNames(className, 'vz-icon-wrapper')}
            text={tooltip}
            color={tooltipColor}
            position={tooltipPosition}
          >
            <SVG
              className={joinClassNames(iconClassName, 'vz-icon', `vz-icon-${toKebabCase(name)}`)}
              width={width}
              height={height}
              color={color}
              {...props}
            />
          </TooltipContainer>
        );
      }
      // hasWrapper and !tooltip and clickable
      if (isClickable) {
        return (
          <Clickable
            className={joinClassNames(className, 'vz-icon-wrapper')}
            onClick={onClick}
            onContextMenu={onContextMenu}
          >
            <SVG
              className={joinClassNames(iconClassName, 'vz-icon', `vz-icon-${toKebabCase(name)}`)}
              width={width}
              height={height}
              color={color}
              {...props}
            />
          </Clickable>
        );
      }
      // hasWrapper and !tooltip and !clickable
      return (
        <div className={joinClassNames(className, 'vz-icon-wrapper')}>
          <SVG
            className={joinClassNames(iconClassName, 'vz-icon', `vz-icon-${toKebabCase(name)}`)}
            width={width}
            height={height}
            color={color}
            {...props}
          />
        </div>
      );
    }
    // !hasWrapper
    return <SVG
      name={name}
      className={joinClassNames(iconClassName, 'vz-icon', `vz-icon-${toKebabCase(name)}`)}
      width={width}
      height={height}
      color={color}
      {...props}
    />;
  };

  return render();
});
